pm.test("Update Customer last name matches", function () {
    pm.expect(jsonData.lastName).to.eql(updateCustomer.lastName);
});

pm.test("Update Customer date of birth matches", function () {
    pm.expect(jsonData.dateOfBirth).to.eql(updateCustomer.dateOfBirth);
});

pm.test("Update Customer id matches", function () {
    pm.expect(jsonData.id).to.eql(updateCustomer.id);
});

pm.test("Update Customer createDate matches", function () {
    var updateCustomerCreatedDate = moment(updateCustomer.createdDate).format("YYYY-MM-DDTHH:mm:ss.SSSSS");
    var responseCreatedDate = moment(jsonData.createdDate).format("YYYY-MM-DDTHH:mm:ss.SSSSS");
    pm.expect(responseCreatedDate).to.eql(updateCustomerCreatedDate);
});

pm.test("Update Customer lastModifiedDate does not match", function () {
    pm.expect(jsonData.lastModifiedDate).to.not.eql(updateCustomer.lastModifiedDate);
});

